private long getDeltaComponent(TimeUnit unit, String arg) {
  String raw = getCommandFormat().getOptValue(arg);
  if (raw == null || raw.isEmpty()) {
    return 0;
  }
  Long parsed = Long.parseLong(raw);
  return unit.toMillis(parsed);
}
